#TürkUzayBilimMisyonu Deney 11: UYNA

Türk Uzay Bilim Misyonundaki onüç deneyden biri olan UYNA deneyi ile ilk defa;

Yeni nesil metal malzemelerin mikro yer çekimli ortamda ergitme ve katılaşma süreci nasıl? Uzay, havacılık ve savunma sanayisi için yeni nesil alaşımlar geliştirmek mümkün müdürsorularının yanıtları aranıyor.#GururDuyTürkiye

#TürkUzayBilimMisyonu Deney 10: MESSAGE

Türk Uzay Bilim Misyonundaki onüç deneyden biri olan MESSAGE deneyi ile;

Astronotların bağışıklık sistemleri mikro yer çekimi koşullarında nasıl değişir? Uzayda kalınan süre arttıkça adaptasyon süreci nasıl ilerlersorularının yanıtı aranıyor. #GururDuyTürkiye

Muş da bizim, Diyarbakır da…

Muş’u, Diyarbakır’ı, İstanbul’u, Trabzon’u, Edirne’yi, Muğla’yı ayırt etmeden; 

tüm gençlerimizin hayallerini, projelerini, hedeflerini desteklemeye devam edeceğiz. #GururDuyTürkiye

#TürkUzayBilimMisyonu Deney 9: MİYOKA

Türk Uzay Bilim Misyonundaki onüç deneyden biri olan MİYOKA deneyi ile;

Mikro yer çekimi ortamında gerçekleştirilen kurşunsuz lehimleme ile uzun süreli insanlı uzay görevleri için gerekli olan elektronik yeniden işleme, onarım ve modifikasyon yeteneklerini  geliştirmek mümkün müdürsorusunun cevabı aranıyor.#GururDuyTürkiye
